def calculate_f(x, y, z):
    """"""
    range1 = range(1, 11)
    range2 = range(10, 21)

    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True
    n = sum((1 for num in range1 if is_prime(num)))
    m = sum((1 for num in range2 if is_prime(num)))
    return x ** n / m + z ** y / n
